import React from "react";

import {Sidebar, Menu, MenuItem, SubMenu} from "react-pro-sidebar";

import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faHome} from "@fortawesome/free-solid-svg-icons";


function SideBar() {
    return (<Sidebar
        collapsed={true}
        collapsedWidth={"48px"}
        backgroundColor={"#181818"}
        rootStyles={{height: "100vh", display: "flex", flexDirection: "column", borderRight: "1px solid #3E3E3E"}}
    >
        <Menu menuItemStyles={{
            margin: "0",
            padding: "0",
        }}>
            <MenuItem icon={<FontAwesomeIcon icon={faHome} style={{color: "white", margin: "0"}}/>}/>
        </Menu>
    </Sidebar>);
}

export default SideBar;
